              },
              {
                id: "o",
                size: "sl",
                location: { x: 0, y: 2 },
                title: "Охорона здоров'я",
                chartConfig: {
                  options: {
                    chart: {
                      id: "bar-chart",
                    },
                    plotOptions: {
                      bar: {
                        horizontal: true,
                      },
                    },

                    xaxis: {
                      categories: ["Виконано", "План на 01.01.2024"],
