                title: "Освіта",
                chartConfig: {
                  options: {
                    chart: {
                      id: "bar-chart",
                    },
                    plotOptions: {
                      bar: {
                        horizontal: true,
                      },
                    },

                    xaxis: {
                      categories: ["Виконано", "План на 01.01.2024"],
                    },
                  },
                  series: [
                    {
                      data: [74, 100],
                    },
                  ],
                  type: "bar",
                  aditionalSetings: {
                    singleInfo: null,
                    filterSelects: [],
                  },
                },
              },
              {
